('admin','custom_report','FISMA Report','a:10:{s:2:\"ds\";a:32:{i:440;a:1:{s:5:\"notes\";N;}i:380;a:3:{s:5:\"title\";s:12:\"FISMA Report\";s:8:\"comments\";s:532:\"The Federal Information Security Management Act (FISMA) Implementation Project was established in January 2003 to produce several key security standards and guidelines required by Congressional legislation. &lt;br&gt;&lt;br&gt;FISMA organizes security controls in 5 sections: AC (access Control); AU (Audit and Accountability); SC (System and Communications Protection); IR (Incident Response); and SI (System and Information Integrity).&lt;br&gt;&lt;br&gt;This report provides support for a systematic review of these requirements.\";s:5:\"notes\";N;}i:402;a:1:{s:5:\"notes\";N;}i:381;a:3:{s:5:\"title\";s:31:\"SECTION I. Access Controls (AC)\";s:8:\"comments\";s:0:\"\";s:5:\"notes\";N;}i:1029;a:3:{s:3:\"top\";s:2:\"25\";s:10:\"sourcetype\";s:0:\"\";s:5:\"notes\";s:0:\"\";}i:1030;a:3:{s:3:\"top\";s:2:\"25\";s:10:\"sourcetype\";s:0:\"\";s:5:\"notes\";s:0:\"\";}i:404;a:1:{s:5:\"notes\";N;}i:382;a:3:{s:5:\"title\";s:89:\"SECTIONS II & V. Audit and Accountability (AU), and System and Information Integrity (SI)\";s:8:\"comments\";s:0:\"\";s:5:\"notes\";N;}i:144;a:1:{s:5:\"notes\";s:0:\"\";}i:143;a:1:{s:5:\"notes\";s:0:\"\";}i:142;a:2:{s:3:\"top\";s:2:\"10\";s:5:\"notes\";s:0:\"\";}i:141;a:2:{s:3:\"top\";s:2:\"10\";s:5:\"notes\";s:0:\"\";}i:140;a:2:{s:3:\"top\";s:2:\"10\";s:5:\"notes\";s:0:\"\";}i:401;a:1:{s:5:\"notes\";N;}i:383;a:3:{s:5:\"title\";s:54:\"SECTION III. System and Communications Protection (SC)\";s:8:\"comments\";s:0:\"\";s:5:\"notes\";N;}i:1038;a:3:{s:3:\"top\";s:2:\"25\";s:10:\"sourcetype\";s:0:\"\";s:5:\"notes\";s:0:\"\";}i:461;a:2:{s:8:\"location\";s:5:\"Local\";s:5:\"notes\";s:0:\"\";}i:462;a:2:{s:8:\"location\";s:5:\"Local\";s:5:\"notes\";s:0:\"\";}i:464;a:2:{s:8:\"location\";s:5:\"Local\";s:5:\"notes\";s:0:\"\";}i:463;a:2:{s:8:\"location\";s:5:\"Local\";s:5:\"notes\";s:0:\"\";}i:400;a:1:{s:5:\"not