('admin','custom_report','HIPAA Report','a:10:{s:2:\"ds\";a:34:{i:440;a:1:{s:5:\"notes\";N;}i:385;a:3:{s:5:\"title\";s:12:\"HIPAA Report\";s:8:\"comments\";s:796:\"\r\n&lt;div&gt;&lt;div&gt;The Health Insurance Portability &amp;amp; Accountability Act of 1996, Public Law 104-191&amp;nbsp;requires improved efficiency in healthcare delivery by standardizing&amp;nbsp;electronic data interchange, as well as the protection of confidentiality and security of health data through setting and&amp;nbsp;enforcing standards.&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;This report provides support for a systematic review of some of the HIPAA requirements.&amp;nbsp;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;Note: The asset configuration of the report should be limited to healthcare data servers and security and network devices&amp;nbsp;involved in the healthcare data transmission.&lt;/div&gt;\r\n\";s:5:\"notes\";N;}i:402;a:1:{s:5:\"notes\";N;}i:380;a:3:{s:5:\"title\";s:35:\"SECTION I. Prevention and Detection\";s:8:\"comments\";s:276:\"\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;div&gt;This section of the report is intended for an operational review of the security of the system to comply with HIPAA 164.308.1 and 164.308.1b requirement of implementing and reviewing detection and prevention security controls. &lt;br&gt;&lt;/div&gt;\r\n\";s:5:\"notes\";N;}i:384;a:3:{s:5:\"title\";s:35:\"Review Review Metrics of the System\";s:8:\"comments\";s:363:\"\r\n\r\n\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; line-height: normal;&quot;&gt;&lt;font class=&quot;Apple-style-span&quot; face=&quot;NewCenturySchlbk-Roman, serif&quot;&gt;&lt;font class=&quot;Apple-style-span&quot; face=&quot;Arial, Tahoma&quot;&gt;Risk Metrics for the period.&lt;br&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n\";s:5:\"notes\";N;}i:283;a:1:{s:5:\"notes\";s:0:\"\";}i:403;a:1:{s:5:\"notes\";N;}i:386;a:3:{s:5:\"title\"