('admin','custom_report','PCI 3.0 Report','a:12:{s:2:\"ds\";a:55:{i:440;a:7:{s:4:\"logo\";N;s:9:\"maintitle\";s:14:\"PCI 3.0 Report\";s:11:\"it_security\";s:0:\"\";s:7:\"address\";s:0:\"\";s:4:\"tlfn\";s:0:\"\";s:4:\"date\";s:5:\"#DATE\";s:5:\"notes\";s:0:\"\";}i:385;a:3:{s:5:\"title\";s:20:\"PCI Technical Report\";s:8:\"comments\";s:1240:\"&lt;br&gt;The Processing Card Industry Security Standard defines the following twelve requirements:&lt;br&gt;&lt;br&gt;1. Install and maintain a firewall configuration to protect cardholder data &lt;br&gt;2. Do not use vendor supplied defaults for system password and other security parameters.&lt;br&gt;3. Protect stored cardholder data &lt;br&gt;4. Encrypt the transmission of cardholder data across open, public networks.&lt;br&gt;5. Use and regularly update antivirus software&lt;br&gt;6. Develop and maintain secure systems and applications&lt;br&gt;7. Restrict access to cardholder data by businessneed-to-know&lt;br&gt;8. Assign a unique ID to each person with computer access&lt;br&gt;9. Restrict physical access to cardholder data&lt;br&gt;10. Track and monitor all access to network resources and cardholder data&lt;br&gt;11. Regularly test security systems and processes&lt;br&gt;12. Maintain a policy that addresses information security&lt;br&gt;&lt;br&gt;This report provides support for a systematic review of these requirements.&lt;br&gt;&lt;br&gt;Note: The asset configuration of the report should be limited to cardholder data servers and security and network devices involved in the cardholder data transmission.&lt;br&gt;\";s:5:\"notes\";s:0:\"\";}i:404;a:1:{s:5:\"notes\";N;}i:387;a:3:{s:5:\"title\";s:28:\"Compliance Executive Summary\";s:8:\"comments\";s:0:\"\";s:5:\"notes\";s:0:\"\";}i:179;a:1:{s:5:\"notes\";s:0:\"\";}i:407;a:1:{s:5:\"notes\";N;}i:380;a:3:{s:5:\"title\";s:13:\"Requirement 1\";s:8:\"comments\";s:307:\"&lt;h3 style=&quot;text-align: center;&quot;&gt;Requirement 1: Install and Maintain a Firewall Configuration&lt;b