-- 
-- ALIENVAULT REPORTING FEED
-- 

CREATE TEMPORARY TABLE IF NOT EXISTS tmprep ENGINE=MEMORY AS (SELECT * FROM alienvault.user_config LIMIT 0);

DELETE c FROM alienvault.user_config c,tmprep t WHERE t.login=c.login AND t.category=c.category AND t.name=c.name AND t.value=c.value;
DROP TABLE IF EXISTS tmprep;
DELETE FROM alienvault.user_config WHERE category LIKE "custom_report_%";
DELETE FROM alienvault.custom_report_types WHERE id > 500000;
